import React from 'react'
import Create from './Components/Create'
import { Router as BrowserRouter, Route, Routes } from 'react-router-dom'

const App = () => {
  return (
    <div>
  <React.Fragment>
    <Router>
    <Routes>
        <Route path="/" exact component={Create} />
        {/* <Route path="/about" exact component={About} />  */}
    </Routes>
    </Router>
  </React.Fragment>
  {/* <Create /> */}
    </div>
  )
}

export default App
